import React from "react";
import LargeComponent from "../ItemsCollection/LargeComponent";
import Component1 from "../Item/Component1";
const Result =(props)=>{
    const year = props.year;
    console.log(year);
    if (year === 2019) {
        return (
            <div>
                <Component1 
                date = {props.items[3].date}
                title = {props.items[3].title}
                price = {props.items[3].price}/>
            </div>
        );
    }
    else if (year === 2020) {
        return (
            <div>
                <Component1 
                date = {props.items[2].date}
                title = {props.items[2].title}
                price = {props.items[2].price}/>
            </div>
        );
    }
    else if (year === 2021) {
        return (
            <div>
                <Component1 
                date = {props.items[1].date}
                title = {props.items[1].title}
                price = {props.items[1].price}/>
            </div>
        );
    }
    else if (year === 2022) {
        return (
            <div>
                <Component1 items= {props.items[0]}/>
                <Component1 items= {props.items[4]}/>
            </div>
        );
    }
    else {
        return (
            <div>
                <LargeComponent items= {props.items}/>
            </div>
        );
    }
};
export default Result;
